const TableRowItem = () => {

    const id = 1;
    const fullName = "Name1";
    const phone = "Phone number1";
    const note = "Note1";

    return (
        <tr>
            <th scope='row'>1</th>
            <th>Name1</th>
            <th>Phone number1</th>
            <th>Note1</th>
        </tr>
    );
}
export default TableRowItem;
